import logo from './logo.svg';
import './App.css';
import react, { Component } from 'react';

class App extends Component {

  constructor() {
    super();

    this.state = {
      string: "My name is yntymak"
    }

  }

  render() {
    return(
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            {this.state.string}
          </p>
          <button onClick={ () => this.setState({ string: 'Hello Mak'}) }>
            Change text
          </button>
        </header>
      </div>
    );
  }
}

export default App;
